import React from 'react'
import projectElements from "../assets/projectElements";


export default function ProjectCard(){
    return (
        <div>
            {projectElements.map((element => {

                return (
                    <div key={element.id} className="relative px-42 py-22 cursor-pointer rounded top-0 bg-[#2b2b2b]">
                        <a href={element.a} target="_blank" rel="noopener noreferrer">
                            <div className='servic-thumb'>
                                <i className={`${element.icon} text-3xl pl-15 bg-white`}></i>
                                <h1 className='text-white pb-5 hover:text-[#2b2b2b]'>{element.title}</h1>
                                <p className='text-[#696969] font-medium line-height-[25px] tracking-[0.2px] mb-10'>{element.description}</p>
                                <div className='mt-20'>
                                    {element.tech.map((tech, index) => {
                                        return (
                                            <button
                                                key={index}
                                                className='mr-10 px-7 py-2 border border-solid border-gray-300 rounded-full bg-gray-700 text-gray-300 cursor-pointer'
                                            >
                                                {tech}
                                            </button>
                                        );
                                    })}
                                </div>
                            </div>
                        </a>
                    </div>
                )
            }))}
        </div>
    )
}
